import { BrowserRouter, Route, Routes, Navigate } from 'react-router-dom';

import CadastroClientePage from './pages/CadastroClientePage';
import ClientesListPage from './pages/ClientesListPage';  // confere se o nome está assim
import EditarCliente from './pages/EditarCliente';
import BuscaClientes from './components/BuscaClientes';

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/cadastro" element={<CadastroClientePage />} />
        <Route path="/editar/:id" element={<EditarCliente />} />
        <Route path="/" element={<BuscaClientes />} />
        {/* Qualquer rota inválida, volta para home */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </BrowserRouter>
  );
}
